import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import "./Nav.css";
import Dropdown from "../components/Dropdown/Dropdown";
class Nav extends Component {
  render() {
    const {
      match: { params }
    } = this.props;

    console.log(params);
    return (
      <form className="form">
        <div>
          <h1>List of URLs</h1>
        </div>
        <div>
          <Dropdown />
        </div>
      </form>
    );
  }
}
export default withRouter(Nav);
